import React from "react";

const Trending: React.FC = () => {
  return (
    <div className="top-trending">
      <h2>Top Trending</h2>
      <p>Discover the hottest music and artists trending right now!</p>
      <div className="explore-card">Artist 1</div>
      <div className="explore-card">Playlist</div>
      <div className="explore-card">Playlist 3</div>
      <div className="explore-card">Playlist 4</div>
    </div>
  );
};

export default Trending;
